import EditBar from "./ParkingManagement/components/EditBar";
import Notification from "./ParkingManagement/components/Notification";
import ManageBar from "./ParkingManagement/components/ManageBar";
import StatusBar from "./ParkingManagement/components/StatusBar";
import ParkingLot from "./ParkingManagement/components/ParkingLot";

import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

export default function CustServ() {
  return (
    <Router>
      <div className="App">
        <MainNavigation />
        <Routes>
          <Route
            path="/customerService"
            element={
              <>
                <FoodAndBeverageCustomer />
                <ShowFoodAndBeverage />

              </>
            }
          />
        </Routes>

        <Routes>
          <Route
            path="/park"
            element={
              <div className="App text-white">
                <Notification />
                <StatusBar />
                <EditBar />
                <ParkingLot />
                <ManageBar />
              </div>
            }
          />
        </Routes>
      </div>
    </Router>
  )
}
